import React from 'react';
import PizzaCard from './PizzaCard'


const PizzaCardList = ({pizzas}) => {
	const mapper = 'map';
	const PizaComponent = pizzas.mapper((pizza, i) => {
    return (
      <PizzaCard key={i}
        pizza = {pizza} />
    )
  })
  return (
  	<div className="AllSabores">
  	{PizaComponent}
    </div>
  );
};

export default PizzaCardList;
